import React from "react";
import logo from "../images/crypto-call-logo.png"
import igLogo from "../images/ig-logo.png"
import twitterLogo from "../images/twitter-logo.png"

function Header (){

    return(
        <div className="header">
            <img src={logo} alt="crypto call logo"/>
            {/* <h1>The Crypto Call</h1> */}

            <svg>
                <rect fill="slategray" width="200" height="60"></rect>
                <image href={igLogo} width="40" height="40" x="20" y="10"></image>
                <image href={twitterLogo} width="40" height="40" x="80" y="10"></image>
            </svg>

        </div>
    );
}

export default Header;
